import React from "react";
import styled, { css } from "styled-components";
import onCellSelect from '../../actions'

const Container = styled.div`
  height: 44px;
  width: 10%;
  border: 1px solid black;
  ${({ isSelected }) =>
    isSelected &&
    css`
      background: red;
    `}
`;

function Cell({ selected, row, column }) {
  const onClick = () => {
    onCellSelect(row, column);
  };

  return <Container isSelected={selected} onClick={onClick} />;
}

export default Cell;
